import React, {useState} from 'react'
import ReactStars from 'react-stars';

const Cards = () => {
  const [data, setData] = useState([
    {
      name: "Ratsasan",
      year: "2022",
      rating: 4,
      img: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcT8Q9JG-WptxaThfsQ-gJtetMMKCctHCn4862wLDE5NPa0W_-m7VbGiDAEFJZiRFs-LAA0&usqp=CAU",
    },
    {
      name: "Ratsasan",
      year: "2022",
      rating: 2,
      img: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcT8Q9JG-WptxaThfsQ-gJtetMMKCctHCn4862wLDE5NPa0W_-m7VbGiDAEFJZiRFs-LAA0&usqp=CAU",
    },
    {
      name: "Ratsasan",
      year: "2022",
      rating: 3.5,
      img: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcT8Q9JG-WptxaThfsQ-gJtetMMKCctHCn4862wLDE5NPa0W_-m7VbGiDAEFJZiRFs-LAA0&usqp=CAU",
    },
    {
      name: "Ratsasan",
      year: "2022",
      rating: 1,
      img: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcT8Q9JG-WptxaThfsQ-gJtetMMKCctHCn4862wLDE5NPa0W_-m7VbGiDAEFJZiRFs-LAA0&usqp=CAU",
    },
    {
      name: "Ratsasan",
      year: "2022",
      rating: 5,
      img: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcT8Q9JG-WptxaThfsQ-gJtetMMKCctHCn4862wLDE5NPa0W_-m7VbGiDAEFJZiRFs-LAA0&usqp=CAU",
    },
    {
      name: "Ratsasan",
      year: "2022",
      rating: 5,
      img: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcT8Q9JG-WptxaThfsQ-gJtetMMKCctHCn4862wLDE5NPa0W_-m7VbGiDAEFJZiRFs-LAA0&usqp=CAU",
    },{
      name: "Ratsasan",
      year: "2022",
      rating: 5,
      img: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcT8Q9JG-WptxaThfsQ-gJtetMMKCctHCn4862wLDE5NPa0W_-m7VbGiDAEFJZiRFs-LAA0&usqp=CAU",
    },
    {
      name: "Ratsasan",
      year: "2022",
      rating: 5,
      img: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcT8Q9JG-WptxaThfsQ-gJtetMMKCctHCn4862wLDE5NPa0W_-m7VbGiDAEFJZiRFs-LAA0&usqp=CAU",
    },
  ]);
  return (
    <div className='flex flex-wrap justify-between p-3 mt-2'>
      {data.map((e, i) => {
        return (
          <div key={i} className='card font-medium shadow-lg p-2
         hover:-translate-y-4 cursor-pointer mt-6 transition-all duration-500'>
            <img className='h-72' src={e.img}/>
            <h1><span className='text-blue-500'>Name:</span> {e.name} </h1>
            <h1 className='flex items-center'><span className='text-blue-500 mr-1'>Rating:</span> 
            <ReactStars size={20} 
            half={true}
            value={e.rating}
            edit={false}
            /></h1>
            <h1><span className='text-blue-500'>Year:</span> {e.year} </h1>
          </div>
        )
      })}
    </div>
  )
}

export default Cards;
